import React from "react";
import img from  "../images/Group 1541.svg";
import calendar from "../images/Select_date-01.svg";
import time from "../images/Set_time-01.svg";

import "./Main.css";

const Main = () => {
    return (
        <>
    <div className="header">
        <img src={img} alt="" />
        <h1>Select Dishes</h1>
    </div>

    <div className="relative flex flex-col justify-center items-center">
        <div className="bg-black h-12 absolute top-0 w-full z-[-1]"></div>
        <div className="flex justify-between bg-white px-3 py-5 rounded-2xl">
                <div className="flex">
                    <img src={calendar} alt="" />
                    <p className="mx-3">21 May 2021</p>
                </div>
                <div className="vertical"></div>
                <div className=" flex">
                    <img src={time} alt="" />
                    <p className="mx-3">10:30 Pm- 12:30 Pm</p>
                </div>
        </div>
        </div>
    </>
    )
}
export default Main;
